package com.thalhamer.numbersgame.domain;/** * LevelData * <p/> * Created by Brian on 5/30/2015. */public class LevelData {    private Integer epic;    private Integer section;    private Integer level;    private String levelName;    private Integer numOfStars;    public LevelData() {    }    public LevelData(Integer epic, Integer section, Integer level) {        this.epic = epic;        this.section = section;        this.level = level;    }    public Integer getEpic() {        return epic;    }    public void setEpic(Integer epic) {        this.epic = epic;    }    public Integer getSection() {        return section;    }    public void setSection(Integer section) {        this.section = section;    }    public Integer getLevel() {        return level;    }    public void setLevel(Integer level) {        this.level = level;    }    public String getLevelName() {        return levelName;    }    public void setLevelName(String levelName) {        this.levelName = levelName;    }    public Integer getNumOfStars() {        return numOfStars;    }    public void setNumOfStars(Integer numOfStars) {        this.numOfStars = numOfStars;    }}